import React from 'react'

const Project = () => {
    return (
        <>
            <section id="Projects">
                <div className="container">
                <h1 className="p-5 bg-dark text-light text-center">MY PROJECTS</h1>

                </div>
            </section>
        </>
    )
}

export default Project
